import React from 'react';
import './App.css';
import Toggler from './Toggler';
import TogglerWithCustomHook from './TogglerWithCustomHook';
import SimpleFormHooks from './SimpleFormHooks';

function App() {
	return (
		<div className='App'>
			<div>
				<Toggler />
				<TogglerWithCustomHook />
			</div>

			<div>
				<SimpleFormHooks />
			</div>
		</div>
	);
}

export default App;
